import React, { Component } from 'react';
import Headline from './components/Headline';

class App extends Component {

  render(){
    return(
      <header>
        <Headline type="title" text="Pokedex" />
        <Headline type="subtitle" text="Pokedex" />
      </header>
    );
  }
}

export default App;
